import React from 'react';
import Tile from './Tile.js';

class Map extends React.Component {
  constructor(props) {
    super(props);
    this.map = props.map;
    this.handleClick = props.handleClick;
    this.handleDrop = props.handleDrop;

  }

  render() {
    return (
      <div className="grid-row">
        <Tile row={0} col={0} type={this.map[0][0][0]} title={this.map[0][0][1]} info={this.map[0][0][2]} highlight={this.map[0][0][3]} click={this.handleClick} drop={this.handleDrop} />
        <Tile row={0} col={1} type={this.map[0][1][0]} title={this.map[0][1][1]} info={this.map[0][1][2]} highlight={this.map[0][1][3]} click={this.handleClick} drop={this.handleDrop} />
        <Tile row={0} col={2} type={this.map[0][2][0]} title={this.map[0][2][1]} info={this.map[0][2][2]} highlight={this.map[0][2][3]} click={this.handleClick} drop={this.handleDrop} />
      </div>
    )
  }
}

export default Map
